import React, { useState } from 'react';
import './App.css'; // Import your CSS file for styling

function App() {
  const [currentPage, setCurrentPage] = useState('Home');

  const handlePageChange = (page) => {
    setCurrentPage(page);
  };

  return (
    <div className="app-container">
      <Navbar currentPage={currentPage} onPageChange={handlePageChange} />
      <div className="content">
        {currentPage === 'Home' && <Home />}
        {currentPage === 'About' && <About />}
        {currentPage === 'Services' && <Services />}
        {currentPage === 'Bookings' && <Bookings />}
      </div>
      <Footer />
    </div>
  );
}

function Navbar({ currentPage, onPageChange }) {
  return (
    <nav>
      <ul>
        <li className={currentPage === 'Home' ? 'active' : ''}>
          <button onClick={() => onPageChange('Home')}>Home</button>
        </li>
        <li className={currentPage === 'About' ? 'active' : ''}>
          <button onClick={() => onPageChange('About')}>About Us</button>
        </li>
        <li className={currentPage === 'Services' ? 'active' : ''}>
          <button onClick={() => onPageChange('Services')}>Services</button>
        </li>
        <li className={currentPage === 'Bookings' ? 'active' : ''}>
          <button onClick={() => onPageChange('Bookings')}>Bookings</button>
        </li>
      </ul>
    </nav>
  );
}

function Home() {
  return (
    <div className="main-section">
      <div className="center">
        <div className="rectangle">
          <p className="box-text">
            HoopCity is a very helping organization that focuses on the famous sport of basketball.
            We aim to help everyone improve their ability on the court. As well as reservations for some pick up fun!
          </p>
        </div>
      </div>
    </div>
  );
}

function About() {
  return <h1>About Us Page</h1>;
}

function Services() {
  return <h1>Services Page</h1>;
}

function Bookings() {
  return <h1>Bookings Page</h1>;
}

function Footer() {
  return (
    <footer>
      <div className="footer-content">
        <div className="footer-section">
          <h3>Address</h3>
          <p>1122 Conroy Dr.</p>
          <p></p>
        </div>
        <div className="footer-section">
          <h3>Hours</h3>
          <p>Monday-Friday: 9am-6pm</p>
          <p>Saturday: 10am-4pm</p>
          <p>Sunday: Closed</p>
        </div>
        <div className="footer-section">
          <h3>Owner</h3>
          <p>John Doe</p>
        </div>
      </div>
    </footer>
  );
}

export default App;
